        super()
        this.state = {
            task: {
                text: "",
                id: uniqid()
            },
            tasks: [],
        };
    }

    render() {
        // const {task, tasks} = this.state;

        return (
            <div>
                <form>
                    <label for="name">Name: </label>
                    <input type="text"></input>
                    <label for="email">Email: </label>
                    <input type="email"></input>
                    <label for="phone">Phone:</label>
                    <input type="tel"></input>
                </form>
            </div>
        )
    }
}

export default Personal;
